import React from "react";
import "./style.css";

function Jumbotron() {
    return (
        <div className="jumbotron jumbotron-fluid d-flex align-items-center">
            <div className="container text-center">
             <h1></h1>    (React) Google Book Search
            </div>
        </div>
    );
}

export default Jumbotron;
